USE ChargeMasterDB;
GO

CREATE TABLE dbo.Carriers (
    CarrierID INT PRIMARY KEY IDENTITY(1,1), -- Auto-incrementing primary key
    CarrierName VARCHAR(255) NOT NULL
);

CREATE TABLE dbo.InsurancePlans (
    PlanID INT PRIMARY KEY IDENTITY(1,1), -- Auto-incrementing primary key
    CarrierID INT NOT NULL,
    InsuranceType VARCHAR(255) NOT NULL,
    PlanName VARCHAR(255) NOT NULL,
    FOREIGN KEY (CarrierID) REFERENCES dbo.Carriers(CarrierID) -- Foreign key to the Carriers table
);



CREATE TABLE dbo.InsuranceTypes (
    InsuranceTypeID INT PRIMARY KEY,
    InsuranceType NVARCHAR(255) NOT NULL
);



ALTER TABLE dbo.InsurancePlans
ADD InsuranceTypeID INT;

ALTER TABLE dbo.InsurancePlans
ADD CONSTRAINT FK_InsurancePlans_InsuranceTypes
FOREIGN KEY (InsuranceTypeID) REFERENCES dbo.InsuranceTypes(InsuranceTypeID);







